import React from 'react';
import {Link} from "react-router-dom";

// styles
import { Wrapper, ContextLeft,ContextRight, Image, Header} from './NavBar.styles';


// Image 
import Logo from '../../Image/logo.png'


const NavBar = () => {
    return (
        <Header>
            <Wrapper>
                <ContextRight>
                    <Image src={Logo} />
                </ContextRight>

                <ContextLeft class="nav-links">
                    <button class="close-nav" onclick="closemenu()"><i class="fas fa-times-circle"></i></button>
                    <ul class="links">
                    <li>
                        <form class="uk-search uk-search-navbar uk-width-1-1">
                        <div class="form-group has-search">
                            <span class="fa fa-search form-control-feedback"></span>
                            <input type="text" class="form-control" placeholder="Search"/>
                        </div>
                        </form>
                    </li>

                    <li><a href="#"><i class="fas fa-microphone"></i></a></li>
                    <li><a href="#"></a></li>
                    <li><a href="#"><i class="fas fa-comment"></i></a></li>
                    <li><Link to="/"><i class="fas fa-user-circle"></i></Link></li>
                    <li><a href="#"><i class="fas fa-bell"></i></a></li>
                    </ul>
                </ContextLeft>

            </Wrapper>
        </Header>
    )
};

export default {NavBar};
